n// @import "bootstrap/scss/_jumbotron.scss";\n// @import "bootstrap/scss/_alert.scss";\n// @import "bootstrap/scss/_progress.scss";\n// @import "bootstrap/scss/_media.scss";\n// @import "bootstrap/scss/_list-group.scss";\n// @import "bootstrap/scss/_close.scss";\n// @import "bootstrap/scss/_toasts.scss";\n// @import "bootstrap/scss/_modal.scss";\n// @import "bootstrap/scss/_tooltip.scss";\n// @import "bootstrap/scss/_popover.scss";\n// @import "bootstrap/scss/_carousel.scss";\n// @import "bootstrap/scss/_spinners.scss";\n@import \'bootstrap/scss/_utilities.scss\';\n@import \'bootstrap/scss/_print.scss\';\n\n// @import \'bootstrap-vue/src/index.scss\';\n\n// -----------------\n// Bootstrap Custom Fixes\n// -----------------\n\n// Reset Body Background as #wrapper & #responsive-menu are overlapping\nbody {\n  background: transparent !important;\n  color: #fff;\n}\n\n// Custom Grid Stuff\n[class*=\'col\'].row {\n  margin: 0;\n  padding: 0;\n}\n\n.container.row,\n.container-fluid.row {\n  margin: auto;\n  padding: 0;\n}\n\n.bg-gray {\n  background-color: $primary-gray;\n}\n\n.anchor {\n  position: absolute;\n  margin-top: -200px;\n}\n',"// ---------------------------\n// Sass Options: https://getbootstrap.com/docs/4.0/getting-started/theming/#sass-options\n// ---------------------------\n$enable-rounded: false; // default true\n$enable-responsive-font-sizes: true; // default false\n$enable-caret: false; // default true\n$enable-validation-icons: false; // default true\n$enable-deprecation-messages: false; // default true\n\n// ---------------------------\n// Colors\n// ---------------------------\n$primary: #d11c45;\n$primary-dark: darken($primary, 10%);\n$primary-light: lighten($primary, 10%);\n$primary-gray: #979494;\n$primary-gray-dark: darken($primary-gray, 10%);\n$primary-gray-light: lighten($primary-gray, 20%);\n$primary-gray-lighter: lighten($primary-gray, 30%);\n$primary-shadow: darken($primary, 90%);\n$body-bg: #e40039;\n$body-color: #111;\n\n:root {\n  --body-bg: #{$body-bg};\n  --body-color: #{$body-color};\n  --primary-shadow: #{$primary-shadow};\n  --primary-dark: #{$primary-dark};\n  --primary-light: #{$primary-light};\n  --primary-gray: #{$primary-gray};\n  --primary-gray-dark: #{$primary-gray-dark};\n  --primary-gray-light: #{$primary-gray-light};\n  --primary-gray-lighter: #{$primary-gray-lighter};\n}\n\n// ---------------------------\n// Links\n// ---------------------------\n\n// $link-color: theme-color('primary');\n// $link-decoration: none;\n// $link-hover-color: darken($link-color, 15%);\n// $link-hover-decoration: underline;\n\n// ---------------------------\n// Spacing & Sizes\n// ---------------------------\n$spacer: 1rem; // default 1rem\n// $paragraph-margin-bottom: 1rem;\n\n$grid-breakpoints: (\n  xxs: 0,\n  xs: 480px,\n  s: 576px,\n  sm: 640px,\n  m: 768px,\n  l: 992px,\n  xl: 1150px,\n  xxl: 1300px,\n);\n\n// $container-max-widths: (\n//   sm: 540px,\n//   md: 720px,\n//   lg: 960px,\n//   xl: 1140px\n// );\n\n:root {\n  --spacer: #{$spacer};\n}\n\n// Bootstrap Functional Imports\n@import 'bootstrap/scss/_functions.scss';\n@import 'bootstrap/scss/_variables.scss';\n@import 'bootstrap/scss/_mixins.scss';\n",":root {\n  // Custom variable values only support SassScript inside `#{}`.\n  @each $color, $value in $colors {\n    --#{$color}: #{$value};\n  }\n\n  @each $color, $value in $theme-colors {\n    --#{$color}: #{$value};\n  }\n\n  @each $bp, $value in $grid-breakpoints {\n    --breakpoint-#{$bp}: #{$value};\n  }\n\n  // Use `inspect` for lists so that quoted items keep the quotes.\n  // See https://github.com/sass/sass/issues/2383#issuecomment-336349172\n  --font-family-sans-serif: #{inspect($font-family-sans-serif)};\n  --font-family-monospace: #{inspect($font-family-monospace)};\n}\n",'// stylelint-disable declaration-no-important, selector-no-qualifying-type, property-no-vendor-prefix\n\n// Reboot\n//\n// Normalization of HTML elements, manually forked from Normalize.css to remove\n// styles targeting irrelevant browsers while applying new styles.\n//\n// Normalize is licensed MIT. https://github.com/necolas/normalize.css\n\n\n// Document\n//\n// 1. Change from `box-sizing: content-box` so that `width` is not affected by `padding` or `border`.\n// 2. Change the default font family in all browsers.\n// 3. Correct the line height in all browsers.\n// 4. Prevent adjustments of font size after orientation changes in IE on Windows Phone and in iOS.\n// 5. Change the default tap highlight to be completely transparent in iOS.\n\n*,\n*::before,\n*::after {\n  box-sizing: border-box; // 1\n}\n\nhtml {\n  font-family: sans-serif; // 2\n  line-height: 1.15; // 3\n  -webkit-text-size-adjust: 100%; // 4\n  -webkit-tap-highlight-color: rgba($black, 0); // 5\n}\n\n// Shim for "new" HTML5 structural elements to display correctly (IE10, older browsers)\n// TODO: remove in v5\n// stylelint-disable-next-line selector-list-comma-newline-after\narticle, aside, figcaption, figure, footer, header, hgroup, main, nav, section {\n  display: block;\n}\n\n// Body\n//\n// 1. Remove the margin in all browsers.\n// 2. As a best practice, apply a default `background-color`.\n// 3. Set an explicit initial text-align value so that we can later use\n//    the `inherit` value on things like `<th>` elements.\n\nbody {\n  margin: 0; // 1\n  font-family: $font-family-base;\n  @include font-size($font-size-base);\n  font-weight: $font-weight-base;\n  line-height: $line-height-base;\n  color: $body-color;\n  text-align: left; // 3\n  background-color: $body-bg; // 2\n}\n\n// Future-proof rule: in browsers that support :focus-visible, suppress the focus outline\n// on elements that programmatically receive focus but wouldn\'t normally show a visible\n// focus outline. In general, this would mean that the outline is only applied if the\n// interaction that led to the element receiving programmatic focus was a keyboard interaction,\n// or the browser has somehow determined that the user is primarily a keyboard user and/or\n// wants focus outlines to always be presented.\n//\n// See https://developer.mozilla.org/en-US/docs/Web/CSS/:focus-visible\n// and https://developer.paciellogroup.com/blog/2018/03/focus-visible-and-backwards-compatibility/\n[tabindex="-1"]:focus:not(:focus-visible) {\n  outline: 0 !important;\n}\n\n\n// Content grouping\n//\n// 1. Add the correct box sizing in Firefox.\n// 2. Show the overflow in Edge and IE.\n\nhr {\n  box-sizing: content-box; // 1\n  height: 0; // 1\n  overflow: visible; // 2\n}\n\n\n//\n// Typography\n//\n\n// Remove top margins from headings\n//\n// By default, `<h1>`-`<h6>` all receive top and bottom margins. We nuke the top\n// margin for easier control within type scales as it avoids margin collapsing.\n// stylelint-disable-next-line selector-list-comma-newline-after\nh1, h2, h3, h4, h5, h6 {\n  margin-top: 0;\n  margin-bottom: $headings-margin-bottom;\n}\n\n// Reset margins on paragraphs\n//\n// Similarly, the top margin on `<p>`s get reset. However, we also reset the\n// bottom margin to use `rem` units instead of `em`.\np {\n  margin-top: 0;\n  margin-bottom: $paragraph-margin-bottom;\n}\n\n// Abbreviations\n//\n// 1. Duplicate behavior to the data-* attribute for our tooltip plugin\n// 2. Add the correct text decoration in Chrome, Edge, IE, Opera, and Safari.\n// 3. Add explicit cursor to indicate changed behavior.\n// 4. Remove the bottom border in Firefox 39-.\n// 5. Prevent the text-decoration to be skipped.\n\nabbr[title],\nabbr[data-original-title] { // 1\n  text-decoration: underline; // 2\n  text-decoration: underline dotted; // 2\n  cursor: help; // 3\n  border-bottom: 0; // 4\n  text-decoration-skip-ink: none; // 5\n}\n\naddress {\n  margin-bottom: 1rem;\n  font-style: normal;\n  line-height: inherit;\n}\n\nol,\nul,\ndl {\n  margin-top: 0;\n  margin-bottom: 1rem;\n}\n\nol ol,\nul ul,\nol ul,\nul ol {\n  margin-bottom: 0;\n}\n\ndt {\n  font-weight: $dt-font-weight;\n}\n\ndd {\n  margin-bottom: .5rem;\n  margin-left: 0; // Undo browser default\n}\n\nblockquote {\n  margin: 0 0 1rem;\n}\n\nb,\nstrong {\n  font-weight: $font-weight-bolder; // Add the correct font weight in Chrome, Edge, and Safari\n}\n\nsmall {\n  @include font-size(80%); // Add the correct font size in all browsers\n}\n\n//\n// Prevent `sub` and `sup` elements from affecting the line height in\n// all browsers.\n//\n\nsub,\nsup {\n  position: relative;\n  @include font-size(75%);\n  line-height: 0;\n  vertical-align: baseline;\n}\n\nsub { bottom: -.25em; }\nsup { top: -.5em; }\n\n\n//\n// Links\n//\n\na {\n  color: $link-color;\n  text-decoration: $link-decoration;\n  background-color: transparent; // Remove the gray background on active links in IE 10.\n\n  @include hover() {\n    color: $link-hover-color;\n    text-decoration: $link-hover-decoration;\n  }\n}\n\n// And undo these styles for placeholder links/named anchors (without href).\n// It would be more straightforward to just use a[href] in previous block, but that\n// causes specificity issues in many other styles that are too complex to fix.\n// See https://github.com/twbs/bootstrap/issues/19402\n\na:not([href]):not([class]) {\n  color: inherit;\n  text-decoration: none;\n\n  @include hover() {\n    color: inherit;\n    text-decoration: none;\n  }\n}\n\n\n//\n// Code\n//\n\npre,\ncode,\nkbd,\nsamp {\n  font-family: $font-family-monospace;\n  @include font-size(1em); // Correct the odd `em` font sizing in all browsers.\n}\n\npre {\n  // Remove browser default top margin\n  margin-top: 0;\n  // Reset browser default of `1em` to use `rem`s\n  margin-bottom: 1rem;\n  // Don\'t allow content to break outside\n  overflow: auto;\n  // Disable auto-hiding scrollbar in IE & legacy Edge to avoid overlap,\n  // making it impossible to interact with the content\n  -ms-overflow-style: scrollbar;\n}\n\n\n//\n// Figures\n//\n\nfigure {\n  // Apply a consistent margin strategy (matches our type styles).\n  margin: 0 0 1rem;\n}\n\n\n//\n// Images and content